export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:d,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:d,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:d,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},tQYBKdL98T:{data:{id:2659,attributes:{imdbId:"tt0043067",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYzFlMzUxN2UtNGJhMi00NjJkLTk0M2YtNjk5NjRlN2YxNTgxXkEyXkFqcGdeQXVyMDI2NDg0NQ@@._V1_SX300.jpg",type:d,ratings:[{Source:"Internet Movie Database",Value:"6.9\u002F10"},{Source:"Metacritic",Value:"89\u002F100"}],item_lang:{data:{id:3322,attributes:{title:b,plot:"Enchanted by the idea of locating treasure buried by Captain Flint, Squire Trelawney, Dr. Livesey and Jim Hawkins charter a sailing voyage to a Caribbean island. Unfortunately, a large number of Flint's old pirate crew are aboard the ship, including Long John Silver.",slug:"treasure-island"}}},books:{data:[{id:12720,attributes:{title:b,description:"Treasure Island is an adventure novel by Scottish author Robert Louis Stevenson, narrating a tale of \"buccaneers and buried gold\". It was originally serialized in the children's magazine Young Folks between 1881 through 1882 under the title Treasure Island, or the mutiny of the Hispaniola, credited to the pseudonym \"Captain George North\". It was first published as a book on 14 November 1883 by Cassell & Co.Treasure Island is traditionally considered a coming-of-age story, and is noted for its atmosphere, characters, and action. It is also noted as a wry commentary on the ambiguity of morality-as seen in Long John Silver-unusual for children's literature. It is one of the most frequently dramatized of all novels. Its influence is enormous on popular perceptions of pirates, including such elements as treasure maps marked with an \"X\", schooners, the Black Spot, tropical islands, and one-legged seamen bearing parrots on their shoulders.Plot summary Stevenson's map of Treasure Island Jim Hawkins hiding in the apple-barrel, listening to the piratesPART I-\"THE OLD BUCCANEER\"An old sailor, calling himself \"the captain\"-real name \"Billy\" Bones-comes to lodge at the Admiral Benbow Inn on the west English coast during the mid-1700s, paying the innkeeper's son, Jim Hawkins, a few pennies to keep a lookout for a one-legged \"seafaring man.\" A seaman with intact legs shows up, frightening Billy-who drinks far too much rum-into a stroke, and Billy tells Jim that his former shipmates covet the contents of his sea chest. After a visit from yet another man, Billy has another stroke and dies; Jim and his mother (his father has also died just a few days before) unlock the sea chest, finding some money, a journal, and a map. The local physician, Dr. Livesey, deduces that the map is of an island where a deceased pirate-Captain Flint-buried a vast treasure. The district squire, Trelawney, proposes buying a ship and going after the treasure, taking Livesey as ship's doctor and Jim as cabin boy.Robert Louis Stevenson, n� le 13 novembre 1850 � �dimbourg et mort le 3 d�cembre 1894 � Vailima (Samoa), est un �crivain �cossais et un grand voyageur, c�l�bre pour son roman L'�le au tr�sor (1883), pour sa nouvelle L'�trange Cas du docteur Jekyll et de M. Hyde (1886) et pour son r�cit Voyage avec un �ne dans les C�vennes (1879).Stevenson est parfois consid�r� comme un auteur de romans d'aventure ou de r�cits fantastiques pour adolescents, mais son oeuvre a une tout autre dimension : il a d'ailleurs �t� salu� avec enthousiasme par les plus grands de ses contemporains et de ses successeurs. Ses nouvelles et romans manifestent en effet une profonde intelligence de la narration, de ses moyens et de ses effets. Il exploite tous les ressorts du r�cit comme la multiplication des narrateurs et des points de vue, et pratique en m�me temps une �criture tr�s visuelle, propice aux sc�nes particuli�rement frappantes.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=zAkqvgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:true,published:"2016-10-27",publisher:a,subtitle:a}},{id:12721,attributes:{title:b,description:"Perhaps the greatest of all adventure stories for boys and girls, Treasure Island began, a brave boy who finds himself among pirates, and of the sinister pirate-cook Long John Silver holds children as entranced today as it did a century ago. It has appeared with illustrations by many leading artists, but none so apt as Peake's--first published in 1949 and out of print until now.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=WGzQ80gUTAMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:e,published:"2004-03-30",publisher:"Bantam Classics",subtitle:a}},{id:12722,attributes:{title:b,description:"While going through the possessions of a deceased guest who owed them money, the mistress of the inn and her son find a treasure map that leads to a pirate fortune as well as great danger.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=GhfI0MGNwEAC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c,"Deidre S. Laiken"],firstBook:e,published:"2002-01-01",publisher:"ABDO",subtitle:a}},{id:12723,attributes:{title:b,description:"An innkeeper's son finds a treasure map that leads him to a pirate's fortune.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=AZioEsKGYMoC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:e,published:"2002-06-01",publisher:"Scholastic Inc.",subtitle:a}},{id:12724,attributes:{title:"Treasure Island (Legend Classics)",description:"Sit back, relax, and enjoy this classic, beloved adventure.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=yhZrzQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:e,published:"2020-07-30",publisher:"Legend Classics",subtitle:a}}]}}},meta:{}}},prerenderedAt:1681309108396}}("","Treasure Island","Robert Louis Stevenson","movie",null,"series",1))